// Journal Section: Textbox entry
import React from "react";
import { WelcomeContainer, WelcomeContent, WelcomeH1, 
         WelcomeText, WelcomeH2, ButtonContainer, Button } from "./WelcomeElements"
import { ReactComponent as Login } from "../../images/LoginButton.svg";
import { Link } from 'react-router-dom';

const WelcomePage = () => {
    return(
        <WelcomeContainer>
            <WelcomeContent>
                <WelcomeH1>Welcome to Wellness Notes!</WelcomeH1>
                <WelcomeText>
                    A music-recommending journal app with a goal to promote mental health.
                </WelcomeText>
                <br />
                <ButtonContainer>
                    <Link to="/home" padding="0px 0px">
                    <Button>
                        <Login className="login" />
                    </Button>
                    </Link>
                    <WelcomeH2>
                        New Here?
                        <Link to="/spotify_login" padding="0px 0px" text-decoration="none">
                            <text> Sign Up</text>
                        </Link>
                    </WelcomeH2>
                </ButtonContainer>
            </WelcomeContent>
        </WelcomeContainer>
    );
};


export default WelcomePage;
